window.wh_copymenu = function(a) {
  if (JSON) {
    return JSON.parse(JSON.stringify(a));
  }
  var c = a instanceof Array ? [] : {};
  for (var b in a) {
    if (!a.hasOwnProperty(b)) {
      continue;
    }
    if (typeof a[b] == "object" && a[b] !== null) {
      c[b] = window.wh_copymenu(a[b]);
    } else {
      c[b] = a[b];
    }
  }
  return c;
};
